-- ============================================================
-- DATABASE 1: E-COMMERCE PLATFORM (ShopNow)
-- Tables: customers, addresses, categories, products, product_images,
--         product_reviews, sellers, orders, order_items, payments,
--         coupons, cart, wishlist, shipments, returns, notifications
-- ============================================================

CREATE DATABASE IF NOT EXISTS shopnow_ecommerce;
USE shopnow_ecommerce;

CREATE TABLE customers (
  customer_id INT PRIMARY KEY AUTO_INCREMENT,
  first_name VARCHAR(50) NOT NULL,
  last_name VARCHAR(50) NOT NULL,
  email VARCHAR(100) UNIQUE NOT NULL,
  phone VARCHAR(20),
  gender ENUM('Male','Female','Other'),
  date_of_birth DATE,
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  last_login DATETIME,
  is_active BOOLEAN DEFAULT TRUE,
  loyalty_points INT DEFAULT 0,
  customer_tier ENUM('Bronze','Silver','Gold','Platinum') DEFAULT 'Bronze'
);


CREATE TABLE addresses (
  address_id INT PRIMARY KEY AUTO_INCREMENT,
  customer_id INT NOT NULL,
  address_line1 VARCHAR(200),
  address_line2 VARCHAR(200),
  city VARCHAR(100),
  state VARCHAR(100),
  country VARCHAR(100),
  pincode VARCHAR(10),
  is_default BOOLEAN DEFAULT FALSE,
  address_type ENUM('Home','Work','Other'),
  FOREIGN KEY (customer_id) REFERENCES customers(customer_id)
);


CREATE TABLE categories (
  category_id INT PRIMARY KEY AUTO_INCREMENT,
  category_name VARCHAR(100) NOT NULL,
  parent_category_id INT,
  description TEXT,
  is_active BOOLEAN DEFAULT TRUE,
  display_order INT,
  FOREIGN KEY (parent_category_id) REFERENCES categories(category_id)
);


CREATE TABLE sellers (
  seller_id INT PRIMARY KEY AUTO_INCREMENT,
  seller_name VARCHAR(200) NOT NULL,
  email VARCHAR(100) UNIQUE NOT NULL,
  phone VARCHAR(20),
  business_type ENUM('Individual','Partnership','Company','LLP'),
  gst_number VARCHAR(20),
  rating DECIMAL(3,2),
  total_products INT DEFAULT 0,
  total_sales INT DEFAULT 0,
  joined_date DATE,
  city VARCHAR(100),
  is_verified BOOLEAN DEFAULT FALSE
);


CREATE TABLE products (
  product_id INT PRIMARY KEY AUTO_INCREMENT,
  seller_id INT NOT NULL,
  category_id INT NOT NULL,
  product_name VARCHAR(300) NOT NULL,
  brand VARCHAR(100),
  description TEXT,
  price DECIMAL(10,2) NOT NULL,
  discount_percent DECIMAL(5,2) DEFAULT 0,
  stock_quantity INT DEFAULT 0,
  sku VARCHAR(50) UNIQUE,
  weight_kg DECIMAL(6,2),
  rating DECIMAL(3,2),
  total_reviews INT DEFAULT 0,
  is_active BOOLEAN DEFAULT TRUE,
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  FOREIGN KEY (seller_id) REFERENCES sellers(seller_id),
  FOREIGN KEY (category_id) REFERENCES categories(category_id)
);


CREATE TABLE coupons (
  coupon_id INT PRIMARY KEY AUTO_INCREMENT,
  coupon_code VARCHAR(20) UNIQUE NOT NULL,
  discount_type ENUM('Percentage','Fixed') NOT NULL,
  discount_value DECIMAL(10,2) NOT NULL,
  min_order_amount DECIMAL(10,2),
  max_discount_amount DECIMAL(10,2),
  valid_from DATE,
  valid_till DATE,
  usage_limit INT,
  used_count INT DEFAULT 0,
  is_active BOOLEAN DEFAULT TRUE
);


CREATE TABLE orders (
  order_id INT PRIMARY KEY AUTO_INCREMENT,
  customer_id INT NOT NULL,
  coupon_id INT,
  order_date DATETIME NOT NULL,
  expected_delivery_date DATE,
  actual_delivery_date DATE,
  order_status ENUM('Pending','Confirmed','Processing','Shipped','Delivered','Cancelled','Returned') DEFAULT 'Pending',
  subtotal DECIMAL(10,2),
  discount_amount DECIMAL(10,2) DEFAULT 0,
  shipping_charge DECIMAL(10,2) DEFAULT 0,
  tax_amount DECIMAL(10,2) DEFAULT 0,
  total_amount DECIMAL(10,2),
  shipping_address_id INT,
  notes TEXT,
  FOREIGN KEY (customer_id) REFERENCES customers(customer_id),
  FOREIGN KEY (coupon_id) REFERENCES coupons(coupon_id),
  FOREIGN KEY (shipping_address_id) REFERENCES addresses(address_id)
);


CREATE TABLE order_items (
  item_id INT PRIMARY KEY AUTO_INCREMENT,
  order_id INT NOT NULL,
  product_id INT NOT NULL,
  quantity INT NOT NULL,
  unit_price DECIMAL(10,2) NOT NULL,
  discount_percent DECIMAL(5,2) DEFAULT 0,
  final_price DECIMAL(10,2),
  FOREIGN KEY (order_id) REFERENCES orders(order_id),
  FOREIGN KEY (product_id) REFERENCES products(product_id)
);


CREATE TABLE payments (
  payment_id INT PRIMARY KEY AUTO_INCREMENT,
  order_id INT NOT NULL,
  payment_date DATETIME,
  payment_method ENUM('Credit Card','Debit Card','UPI','Net Banking','COD','Wallet','EMI'),
  payment_status ENUM('Pending','Success','Failed','Refunded'),
  amount DECIMAL(10,2),
  transaction_id VARCHAR(100),
  gateway VARCHAR(50),
  FOREIGN KEY (order_id) REFERENCES orders(order_id)
);


CREATE TABLE product_reviews (
  review_id INT PRIMARY KEY AUTO_INCREMENT,
  product_id INT NOT NULL,
  customer_id INT NOT NULL,
  rating INT CHECK (rating BETWEEN 1 AND 5),
  title VARCHAR(200),
  review_text TEXT,
  review_date DATETIME,
  helpful_votes INT DEFAULT 0,
  is_verified_purchase BOOLEAN DEFAULT FALSE,
  FOREIGN KEY (product_id) REFERENCES products(product_id),
  FOREIGN KEY (customer_id) REFERENCES customers(customer_id)
);


CREATE TABLE shipments (
  shipment_id INT PRIMARY KEY AUTO_INCREMENT,
  order_id INT NOT NULL,
  tracking_number VARCHAR(50),
  courier_partner VARCHAR(100),
  shipped_date DATETIME,
  estimated_delivery DATE,
  actual_delivery DATE,
  shipment_status ENUM('Preparing','Shipped','In Transit','Out for Delivery','Delivered','Failed','Returned'),
  origin_city VARCHAR(100),
  destination_city VARCHAR(100),
  FOREIGN KEY (order_id) REFERENCES orders(order_id)
);


CREATE TABLE returns (
  return_id INT PRIMARY KEY AUTO_INCREMENT,
  order_id INT NOT NULL,
  item_id INT NOT NULL,
  return_reason ENUM('Defective','Wrong Item','Not as Described','Changed Mind','Quality Issue','Other'),
  return_status ENUM('Requested','Approved','Picked Up','Refunded','Rejected'),
  requested_date DATE,
  resolved_date DATE,
  refund_amount DECIMAL(10,2),
  comments TEXT,
  FOREIGN KEY (order_id) REFERENCES orders(order_id)
);


CREATE TABLE wishlist (
  wishlist_id INT PRIMARY KEY AUTO_INCREMENT,
  customer_id INT NOT NULL,
  product_id INT NOT NULL,
  added_date DATETIME,
  FOREIGN KEY (customer_id) REFERENCES customers(customer_id),
  FOREIGN KEY (product_id) REFERENCES products(product_id)
);


CREATE TABLE notifications (
  notification_id INT PRIMARY KEY AUTO_INCREMENT,
  customer_id INT NOT NULL,
  title VARCHAR(200),
  message TEXT,
  notification_type ENUM('Order','Offer','Account','Delivery','Review'),
  is_read BOOLEAN DEFAULT FALSE,
  created_at DATETIME,
  FOREIGN KEY (customer_id) REFERENCES customers(customer_id)
);

